import React from 'react';
import { connect } from 'react-redux';
import styled from 'styled-components';
import { Table, Columns, Divider, Pagination } from 'antd';

import { getTodoList, getUser, changePage } from '../redux/actions';

const columns = [
	{
		title: 'ID',
		dataIndex: 'ID',
		key: 'ID'
	},
	{
		title: 'Title',
		dataIndex: 'Title',
		key: 'Title'
	},
	{
		title: 'Completed',
		dataIndex: 'Completed',
		key: 'Completed'
	}
]

const data = this.props.getTodoList();

class Todo extends React.Component{
	componentDidMount() {
		this.props.getTodoList();
		this.props.getUser();
	}

	render() {
		return (
			<div>TodoANt</div>
		)
	}
}

const mapStateToProps = (state) => {
	return { 
		todo: state.todo
	}
}

export default connect(
	mapStateToProps,
	{ getTodoList, getUser, changePage }
)(Todo);
